import Vue from "vue";
import Vuex from "vuex";

Vue.use(Vuex);

export default new Vuex.Store({
  state: {
    list: ["1"],
  },
  mutations: {},
  actions: {
    fetchData({ commit }) {
      setTimeout(() => {
        const projectItemsList = [
          {
            url: "../../assets/images/indexImages/Item1.svg",
            title: "Modern Kitchan",
            text: "Decor / Artchitecture",
          },
          {
            url: "../../assets/images/indexImages/Item1.svg",
            title: "Modern Kitchan",
            text: "Decor / Artchitecture",
          },
          {
            url: "../../assets/images/indexImages/Item1.svg",
            title: "Modern Kitchan",
            text: "Decor / Artchitecture",
          },
          {
            url: "../../assets/images/indexImages/Item1.svg",
            title: "Modern Kitchan",
            text: "Decor / Artchitecture",
          },
        ];

      }, 1500);
    },
  },
  getters: {},
});
